import React from "react";
import Background from '../media/99.jpg'

const Home = () => {
    return(
        <div style={{display:'flex', justifyContent:'center', gap:'50px', alignItems:'center', backgroundImage:`url(${Background})`, backgroundSize:'cover', height:'100vh'}}>
            <p style={{ fontSize:'70px', fontFamily:'Quicksand',}}>Welcome</p>
            <div style={{width:'2px', height:'500px', backgroundColor:'teal'}}/>
            <div style={{ display:'flex', flexDirection:'column' }}>
                <span style={{ fontSize:'36px', marginBottom:'20px', fontFamily:'Quicksand'}}>Digital Portfolio Project Search</span>
                <Typewriter 
                    options={{
                        strings: ['a Student.', 'a Software Engineer.', 'an Intern.', 'a Gamer.', 'a Baker.', 'a Friend.'],
                        autoStart: true,
                        pauseFor: 2000,
                        loop: true,
                        
                    }}/>
                <span>This website contains each of my project's deployments or demonstrations.</span>
                <span>Visit the links above to view my projects.</span>
            </div>
        </div>
    );
} 
export default Home;
